  { label: "Git", width: "3", level: "8", colour: "shade-8" },
  { label: "Agile", width: "3", level: "9", colour: "shade-9" },
  { label: "Design", width: "2", level: "10", colour: "shade-10" },
];

const AboutSection = () => {
  return (
